#include <stdlib.h>
#include <stdio.h>
#include <vector>
#include <cstdlib>
#include <string.h>
using std::vector;

typedef struct Points {
	int row;
	int col;
} Points;

typedef Points ElementType;

typedef struct QNode {
	ElementType data;
	struct QNode *next;
} QNode;

typedef struct Queue {
	QNode *front;
	QNode *rear;
} Queue;

// init Queue
void initQueue(Queue *queueP) {
	queueP->front = NULL;
	queueP->rear = NULL;
}

void enQueue(Queue *queueP, ElementType x) {
	QNode *newP;
	newP = (QNode *) malloc(sizeof(QNode));

	newP->data = x;
	newP->next = NULL;

	if (queueP->rear == NULL) { /* the queueP is empty*/
		queueP->front = newP;
		queueP->rear = newP;
	} else {
		queueP->rear->next = newP;
		queueP->rear = newP;
	}
}

ElementType outQueue(Queue *queueP) {
	if (queueP->front == NULL) {
		printf("%s\n", "the queue is empty");
	} else {
		QNode *p;
		ElementType res; /* the result to return */
		res = queueP->front->data;
		p = queueP->front; /* used to free the front node */
		queueP->front = p->next;
		if (queueP->front == NULL) { /* thers are no nodes*/
			queueP->rear = NULL; 
		}

		free(p); /* free the front node */
		return res;
	}
}

int isEmptyQueue(Queue *queueP) {
	if (queueP->front == NULL) {
		return 1;
	} else {
		return 0;
	}
}

void clearQueue(Queue *queueP) {
	QNode *p;
	p = queueP->front;

	while (p != NULL) {                          /* can't write this :  */
		queueP->front = p->next;                 /*free(p);*/
		free (p);								/* p = p->next */ // because p is freed 
		p = queueP->front;
	}

}

/* queue implement end 
**************************************************************/


void BFS(char **board, int n, int m, int row, int col) { // assume board[row][col] == 'O'
	board[row][col] = 'V';
	Queue queue;
	initQueue(&queue);
	Points newPoint;
	newPoint.row = row;
	newPoint.col = col;
	enQueue(&queue, newPoint);

	while(!isEmptyQueue(&queue)) {
		Points tempPoint;
		tempPoint = outQueue(&queue);
		row = tempPoint.row;
		col = tempPoint.col;
		board[row][col] = 'V'; /* change the O to V */

		if (row >= 1 && board[row - 1][col] == 'O') {
			board[row - 1][col] = 'V';
			tempPoint.row = row - 1;
			tempPoint.col = col;
			enQueue(&queue, tempPoint);
		}

		if (row <= n - 2 && board[row + 1][col] == 'O') {
			board[row + 1][col] = 'V';
			tempPoint.row = row + 1;
			tempPoint.col = col;
			enQueue(&queue, tempPoint);
		}

		if (col >= 0 && board[row][col - 1] == 'O') {
			board[row][col - 1] = 'v';
			tempPoint.row = row;
			tempPoint.col = col - 1;
			enQueue(&queue, tempPoint);
		}

		if (col <= m - 2 && board[row][col + 1] == 'O') {
			board[row][col + 1] = 'V';
			tempPoint.row = row;
			tempPoint.col = col + 1;
			enQueue(&queue, tempPoint);
		}

	}
}


void BFS_first_last_col(char **board, int n, int m) {
	int row = 0;

	for (row = 0; row < n; row++) {
		if (board[row][0] == 'O') { /* search the first column */
			BFS(board, n, m, row, 0);
		}

		if (board[row][m - 1] == 'O') { /* search the last column */
			BFS(board, n, m, row, m - 1);
		}
	}
}

void BFS_first_last_row(char **board, int n, int m) {
	int col = 0;

	for (col = 0; col < m; col++) {
		if (board[0][col] == 'O') { /* the first row */
			BFS(board, n, m, 0, col);
		}

		if (board[n - 1][col] == 'O') {
			BFS(board, n, m, n - 1, col);
		}
	}
}

void change_O_to_X_and_V_to_O(char **board, int n, int m) { // change O to X, and V to O
  int i = 0;
  int j = 0;

  for (i = 0; i < n; i++) {
    for (j = 0; j < m; j++) {
      if (board[i][j] == 'V') {
        board[i][j] = 'O';
      } else if (board[i][j] == 'O') {
        board[i][j] = 'X';
      }
    }
  }
}

// board is n(rows) * m(cols)
void c_solve(char **board, int n, int m) {
  int row = 0;
  int col = 0;
  BFS_first_last_col(board, n, m);
  BFS_first_last_row(board, n, m);
  change_O_to_X_and_V_to_O(board, n, m); 
}

class Solution {
public:
    void solve(vector<vector<char> > &board) {
      int n = board.size();
      int m = 0;
      char **c_board = (char**)malloc(sizeof(char*)*board.size());
      for(int i = 0; i < n; i++) {
        m = board[i].size();
        c_board[i] = (char*)malloc(sizeof(char)*(m+1));
        for(int j = 0; j < m; j++) {
          c_board[i][j] = board[i][j];
        }
        c_board[i][board[i].size()] = '\0';
      }
      c_solve(c_board, n, m);
      for(int i = 0; i < n; i++) {
        for(int j = 0; j < m; j++) {
          board[i][j] = c_board[i][j];
        }
        free(c_board[i]);
      }
      free(c_board);
    }
};

void print_board(char **board) {
  int i, j;
  for (i = 0; i < 5; i++) {
    printf("%s\n", board[i]);
  }
}

